import groovy.json.JsonOutput
import groovy.json.JsonSlurper
import org.apache.nifi.processor.io.StreamCallback
import java.nio.charset.StandardCharsets

// Function to generate dynamic output
def generateDynamicOutput(inputData) {
    def records = []

    // Define possible values for each category
    def ratingScoreTypes = ["Skill", "Importance", "Agreement"]
    def profileScoreTypes = ["Skill_Level", "Importance_Level", "HiddenStrength", "BlindSpot"]
    def stageTypes = ["Stage1", "Stage2", "Stage3", "Stage4"]
    def raterTypes = ["self", "yourManager", "peopleYouLead", "peers", "otherRaters", "otherManager", "managersManager", "customers", "totalOthers"]

    // Add the new condition for "stallers_stoppers_clusters"
    def stallersStoppersClustersPrefixes = ["AntiCluster", "Cluster", "SS"]
    def keywordsToClassifyAsSS = ["Harmfulness", "problem", "Overuse"]
    def keywordsToSkip = ["_PRC", "Model_name", "Model_version"]

    inputData.scoredData.each { key, value ->
        // Skip unwanted keys
        if (keywordsToSkip.any { key.contains(it) }) {
            return
        }

        def parts = key.tokenize("_")

        // Identify competency (everything before "StageX" or ScoreType)
        def competencyIndex = parts.findIndexOf { it.startsWith("Stage") || it in (ratingScoreTypes + profileScoreTypes) }
        def competency = competencyIndex > 0 ? parts[0..(competencyIndex - 1)].join("_") : null

        // Identify stage
        def stageIndex = parts.findIndexOf { it.startsWith("Stage") }
        def stage = stageIndex >= 0 ? parts[stageIndex] : null

        // Identify score type
        def scoreTypeIndex = parts.findIndexOf { it in (ratingScoreTypes + profileScoreTypes) }
        def scoreType = null
        if (scoreTypeIndex >= 0) {
            if (parts.size() > scoreTypeIndex + 1 && (parts[scoreTypeIndex + 1] == "Level")) {
                scoreType = parts[scoreTypeIndex] + "_" + parts[scoreTypeIndex + 1]
            } else {
                scoreType = parts[scoreTypeIndex]
            }
        }

        // Identify rater type
        def raterTypeIndex = parts.findIndexOf { it in raterTypes }
        def raterType = raterTypeIndex >= 0 ? parts[raterTypeIndex] : null

        // Identify behavior (everything between Stage and ScoreType)
        def behavior = (stageIndex >= 0 && scoreTypeIndex > stageIndex + 1) ? parts[(stageIndex + 1)..(scoreTypeIndex - 1)].join("_") : null

        // Determine record type 
        def recordType = null

        if (stallersStoppersClustersPrefixes.any { key.startsWith(it) } ||
            keywordsToClassifyAsSS.any { key.contains(it) }) {
            recordType = "stallers_stoppers_clusters"
        } else if (scoreType in profileScoreTypes) {
            recordType = "participant_competency_profile"
        } else if (key.startsWith("N_Responses") && raterType && !scoreType) {
            recordType = "participant_summary"
        } else if (raterType && scoreType) {
            recordType = stage ? "participant_behavior_rating" : "participant_competency_rating"
        }

        // Convert boolean "True" and "False" to 1 and 0
        def score = value
        if (score == "True" || score == "Yes") {
            score = 1
        } else if (score == "False" || score == "No") {
            score = 0
        }

        // Build record with metadata inline
        def record = [
            "assessmentId": inputData.assessmentId,
            "dateSaved": inputData.dateSaved,
            "SurveyType": inputData.SurveyType,
            "participantId": inputData.participantId,
            "projectId": inputData.projectId,
            "model_name": inputData.scoredData?.Model_name,
            "model_version": inputData.scoredData?.Model_version,
            "id": key
        ]

        if (recordType) {
            record["type"] = recordType
            if (competency) record["competency"] = competency
            if (stage) record["stage"] = stage
            if (behavior) record["behavior"] = behavior
            if (scoreType) record["scoreType"] = scoreType
            if (raterType) record["raterType"] = raterType
            record["score"] = score
        } else {
            record["type"] = "rejected_records"
            record["value"] = value
        }

        records << record
    }

    return records
}

// Fetch metadata attributes
def flowFile = session.get()
if (!flowFile) return

def assessmentId = flowFile.getAttribute('assessmentId')
def dateSaved = flowFile.getAttribute('dateSaved')
def SurveyType = flowFile.getAttribute('SurveyType')
def participantId = flowFile.getAttribute('participantId')
def projectId = flowFile.getAttribute('projectId')

def scoredData = [:]

// Read content (JSON) and extract 'scoredData'
flowFile = session.write(flowFile, { inputStream, outputStream ->
    def jsonText = inputStream.getText(StandardCharsets.UTF_8.name())
    def parsed = new JsonSlurper().parseText(jsonText)
    scoredData = parsed.scoredData ?: [:]

    // If needed, you can replace or write something to outputStream
    outputStream.write(jsonText.getBytes(StandardCharsets.UTF_8)) // preserve original
} as StreamCallback)

def inputData = [
    assessmentId : assessmentId,
    dateSaved    : dateSaved,
    SurveyType   : SurveyType,
    participantId: participantId,
    projectId    : projectId,
    scoredData   : scoredData
]

def output = generateDynamicOutput(inputData)
def outputJson = JsonOutput.prettyPrint(JsonOutput.toJson(output))

// Write new output as content (array of records)
flowFile = session.write(flowFile, { out ->
    out.write(outputJson.getBytes(StandardCharsets.UTF_8))
} as OutputStreamCallback)

session.transfer(flowFile, REL_SUCCESS)

