import groovy.json.JsonOutput

def flowFile = session.get()
if (!flowFile) return

def convertErrorMessage(String message) {
    if (message == null || !message.startsWith("[") || !message.endsWith("]")) {
        return []; // Or handle invalid format as needed
    }

    def errors = []
    def errorStrings = message.substring(1, message.length() - 1).split(', ')

    errorStrings.each { errorString ->
        def parts = errorString.split(': ', limit: 2)
        if (parts.size() == 2) {
            errors << [field: parts[0].trim(), error: parts[1].trim()]
        } else {
            // Handle cases where the format might be unexpected
            errors << [field: errorString.trim(), error: "Invalid error format"]
        }
    }
    return errors
}
try {
    def message = flowFile.getAttribute("message")
    def fieldErrors = convertErrorMessage(message)
    flowFile = flowFile.putAttribute("field.errors.json", JsonOutput.toJson(fieldErrors))
    session.transfer(flowFile, REL_SUCCESS)
} catch (Exception e) {
    log.error("Error processing FlowFile: {}", [e] as Object[])
    session.transfer(flowFile, REL_FAILURE)
}

